using AdminPanel.QuerySide;
using AdminPanel.QuerySide.Category;
using AdminPanel.QuerySide.Menu;
using AdminPanel.QuerySide.Product;
using Microsoft.AspNetCore.Mvc;

namespace AdminPanel.Controllers
{
    [ApiController]
    [Route("api/[controller]")]
    public class ProductController : ControllerBase
    {
        List<Product> _productList = new List<Product>
        {
             new Product
                {
                    Id = 1,
                    Name="TV",
                    Picture="",
                    Color = "blace",
                    Description ="The best TV",
                    CategoryId = 1,
                },

                new Product
                {
                    Id = 2,
                    Name="Microwave",
                    Picture="",
                    Color = "gray",
                    Description ="The best Microwave",
                    CategoryId=1,
                }
        };

        private readonly ILogger<ProductController> _logger;
        public ProductController(ILogger<ProductController> logger)
        {
            _logger = logger;
        }


        [HttpGet("{categoryId}")]
        public List<GetProductsResult> GetRelatedCategoryProduct(int categoryId)
        {
            var relatedProducts = _productList.Where(product => product.CategoryId == categoryId).ToList();

            var result = new List<GetProductsResult>();
            foreach (var product in relatedProducts)
            {
                result.Add(new GetProductsResult
                {
                    Id = product.Id,
                    Name = product.Name,
                    Picture = product.Picture,
                });
            }
            return result;
        }


        [HttpGet("productDetail/{productId}")]
        public ActionResult<GetProductDetailResult> GetProductDetail(int productId)
        {
            var product = _productList.FirstOrDefault(product => product.Id == productId);
            if (product == null) return NotFound();

            return new GetProductDetailResult
            {
                Id = product.Id,
                Color = product.Color,
                Description = product.Description,
                Name = product.Name,
                Picture = product.Picture,
            };
        }
    }
}